window.bookSummaryJSON = "<p>If you could go back in time to witness any concert from all of history, what would it be? Jimi Hendrix at Woodstock? Mozart in the Salzburg court? The Beatles’ rooftop farewell? </p> <p><i>Jukebox Joyride</i> follows 12-year-old twins Jules and George on a wild adventure through time. Their Uncle Bob, a renowned ethnomusicologist (he studies music!), has discovered the secret to time travel and is having a ball joyriding through history checking out the best concerts ever...<i>but something’s gone wrong!</i> A sinister force has been unleashed, someone is chasing after Uncle Bob, and the fate of all music hangs in the balance! </p> <p>Now, it’s up to Jules and George to find their uncle before their new rival does! It’s a musical adventure that brings the twins from the birth of jazz in New Orleans to a performance by an 11- year-old Mozart in Vienna, all while trying to make it back to the present day to pass their history test! </p> <p>Featuring original songs and historical settings, this Audible Original is sure to captivate the entire household. <i>Jukebox Joyride</i> is a swashbuckling adventure that will get kids excited about history and making their own music.</p>"; 
